const AddNewPlaylistModal = ({ isModalOpen, switchModal }) => {
  const outsideModalClickHandler = () => {
    switchModal((prevState) => !prevState);
  };
  const insideModalClickHandler = (e) => {
    e.stopPropagation();
  };
  const closeModal = () => {
    switchModal()
  }
  return (
    <div onClick={outsideModalClickHandler} className="modal-wrapper">
      <div
        onClick={(e) => insideModalClickHandler(e)}
        className="modal center-x m-up-6 shadow"
      >
        <button className="card-cross btn-close is-medium">
          <i className="fas fa-times" />
        </button>
        <i className="modal-icon is-green fas fa-check-circle" />
        <div className="textbox">
          <div className="title text-center">Order Placed!</div>
          <div className="text text-center">
